using iTextSharp.text;
using iTextSharp.text.pdf;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace GestãoEstoque.ClassesOrganização
{
    public class PdfLogoHelper : PdfPageEventHelper
    {
        private readonly Image _logo;

        public PdfLogoHelper()
        {
            try
            {
                string base64Logo = "";
                byte[] imageBytes = Convert.FromBase64String(base64Logo);
                _logo = Image.GetInstance(imageBytes);

                _logo.ScaleToFit(150f, 75f);
            }
            catch
            {
                _logo = null;
            }
        }

        public override void OnEndPage(PdfWriter writer, Document document)
        {
            base.OnEndPage(writer, document);

            if (writer.PageNumber == 1 && _logo != null)
            {
                float posX = 35;
                float posY = PageSize.A4.Height - 110;

                _logo.SetAbsolutePosition(posX, posY);
                writer.DirectContent.AddImage(_logo);
            }
        }
    }

}